/*Table structure for table `aplikasigate` */

DROP TABLE IF EXISTS `aplikasigate`;

/*!50001 DROP VIEW IF EXISTS `aplikasigate` */;
/*!50001 DROP TABLE IF EXISTS `aplikasigate` */;

/*!50001 CREATE TABLE  `aplikasigate`(
 `Tanggal_Done` date ,
 `Jenis` varchar(100) ,
 `Nama_Perangkat` varchar(100) ,
 `Penyebab` varchar(200) ,
 `jumlah` bigint(21) 
)*/;

/*View structure for view aplikasigate */

/*!50001 DROP TABLE IF EXISTS `aplikasigate` */;
/*!50001 DROP VIEW IF EXISTS `aplikasigate` */;

/*!50001 CREATE ALGORITHM=UNDEFINED DEFINER=``@`%` SQL SECURITY DEFINER VIEW `aplikasigate` AS (select `log`.`trouble_et`.`Tanggal_Done` AS `Tanggal_Done`,`log`.`perangkat_vm`.`Jenis` AS `Jenis`,`log`.`perangkat_vm`.`Nama_Perangkat` AS `Nama_Perangkat`,`log`.`penyebab`.`Penyebab` AS `Penyebab`,count(0) AS `jumlah` from (((`trouble_et` join `penyebab` on((`log`.`trouble_et`.`No_Penyebab` = `log`.`penyebab`.`No_Penyebab`))) join `perangkat_vm` on((`log`.`trouble_et`.`No_PVM` = `log`.`perangkat_vm`.`No_PVM`))) join `projek` on((`log`.`trouble_et`.`No_Projek` = `log`.`projek`.`No_Projek`))) where (`log`.`projek`.`Nama_Projek` = 'KCI') group by `log`.`perangkat_vm`.`Nama_Perangkat`,`log`.`penyebab`.`Penyebab`) */;

